import { Link } from 'react-router-dom';
import UserContext from '../../context/userContext';
import Register from './Register';

useEffect(() => {
  const timer = setTimeout(() => {
    console.log('ALERT');
  }, 1000);
  return () => clearTimeout(timer);
}, []);

export const Alert = () => {
  return (
    <div>
      <hr />
      <Register></Register>
    </div>
  );
};

export default Alert;
